import React from 'react'

import {Dialog, Button, Divider, DialogContent, DialogTitle} from '@material-ui/core'
import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles(theme => ({
  root: {
    position: "absolute",
    top: 0,
    marginTop: 10
  },
  closeButton:{
    width: 100,

    marginRight: 5
  }

}))


function ProjectDialog({openDetail, setOpenDetail}) {
  const classes = useStyles()
  return (
    <Dialog 
      open={openDetail} 
      maxWidth="xs" 
      onClose={()=>setOpenDetail(false)} 
      classes={{paper: classes.root}} >
      <DialogTitle>
        <Button 
          size= "small"
          color="secondary" 
          variant="outlined" 
          onClick={()=>setOpenDetail(false)}
            >
              X</Button>
      </DialogTitle>
      {/* <Divider/> */}
      <DialogContent style={{padding: 0}}>
        <img src="https://lp-cms-production.imgix.net/news/2019/02/taj-mahal-monkey.jpg" alt="" srcset="" style={{height: 350 , width: '100%'}} 
      />
      </DialogContent>

    </Dialog>
  )
}

export default ProjectDialog
